import React from "react"
import PropTypes from "prop-types"

const json = require('./overview.json');
const sports = []

for (const [index, value] of json['slider_elements']) {
  items.push(<Element key={json['slider_elements'][0]['desc']} />)
}

class Sports extends React.Component {
  reqListener(e) {
    console.log(json['slider_elements'][0]);
  } 
  render () {
    return (
      <React.Fragment>
        <h1>Sports </h1>
        <div> {json['slider_elements'][0]['desc']} </div>

      </React.Fragment>
    );
  }
}

export default Sports
